const fs = require('fs');

/**
 * Convert a Base64 string to a PDF file.
 * @param {string} base64String - The Base64 string representing the PDF.
 * @param {string} outputFilePath - The file path where the PDF will be saved.
 */
function savePDF(base64String, outputFilePath) {
    // Decode the Base64 string to a Buffer
    const buffer = Buffer.from(base64String, 'base64');

    // Write the buffer to a file
    fs.writeFile(outputFilePath, buffer, (err) => {
        if (err) {
            console.error('Error saving the PDF:', err);
        } else {
            console.log(`PDF saved successfully to ${outputFilePath}`);
        }
    });
}

// Example usage
const base64PDF = ""; // Replace with your Base64 string
const outputFilePath = "output.pdf"; // Specify the desired file path
savePDF(base64PDF, outputFilePath);

